      | 48349 -> { ItemTypeData.id= 48349; name= "6VDT-H Outpost Monument"; published= false; description= "The outpost that once stood here was built by IT Alliance in YC112 and held by The Initiative when it was decommissioned, but it was most famous for the part it played in the Fountain War.    Test Alliance Please Ignore had taken control of the outpost in YC113 as part of their expansion throughout Fountain region. In June of YC115, the CFC coalition invaded Fountain and for months two of the biggest war machines in EVE fought for control of the region. Eventually, CFC fought their way to 6VDT-H, Test's traditional home in the region.    Every available pilot allied to either side flocked to the system. During the siege 4000 pilots were counted in the system, making it the biggest battle New Eden had witnessed at that time. Test fought valiantly but CFC's bombers were savagely effective. With falling numbers and all their escape routes blocked, the remaining Test ships made one final doomed charge into the heart of their enemy's capital fleet. All were destroyed.     Following the battle, Test announced they would be pulling out of Fountain. There would be many future conflicts between Test and CFC, but it was on this spot that the Fountain war ended."; marketGroupId= None; groupId= 1998; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 1500.000000 }; { DogmaAttributeValueData.attributeId = 2787; value= 1900696668.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 100000000.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= Some(3822); mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1500.000000; volume= 0.000000 } |> Some
