      | 55818 -> { ItemTypeData.id= 55818; name= "Xordazh Invasion Cache Wreck"; published= false; description= "The wreck of a Xordazh Invasion Cache.     This Triglavian cache has been deployed by a <i>Xordazh</i>-class World Ark and is evidently intended as a supply point for Triglavian forces engaged in invasion operations in the system. The presence of advanced Triglavian technology and their adaptive mutaplasmid devices in such caches further indicates the intention of the Collective to establish sustained operations in the vicinity. Speculation as to the intended use of mutaplasmids in New Eden systems ranges from mundane logistical purposes to theories of more radical activity focused on planets and other orbital bodies.    EDENCOM-allied capsuleers will likely find it profitable to <color=yellow>destroy and raid</color> these caches following assault operations against invading Triglavian World Arks."; marketGroupId= None; groupId= 186; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 25000.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 250.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 10000.000000 }; { DogmaAttributeValueData.attributeId = 901; value= 30.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 25000.000000 }; { DogmaAttributeValueData.attributeId = 552; value= 5000.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 700.000000 }; { DogmaAttributeValueData.attributeId = 525; value= 1.000000 } |]; dogmaEffects= [|  |]; capacity= 25000.000000; graphicId= Some(22218); mass= 10000.000000; packagedVolume= 25000.000000; portionSize= 1; radius= 250.000000; volume= 25000.000000 } |> Some
